import axios from "axios";

const BASE_URI = "http://localhost:8081";

export const testConnection = () => {
    try {
        // const res = await axios.get(`${BASE_URI}/test-connection`)
        const res = axios.get(`/test-connection`)
        // console.log(res)
        res.then((data)=>{
            console.log(data);
        })
    } catch (error) {
        console.log(error)
    }
}
